void ShowGauss(void)
{

    GUI_SetFont(GUI_FONT_16B_1);
    GUI_SetColor(GUI_BLACK);
    GUI_SetBkColor(GUI_WHITE);
    GUI_Clear();
    GUI_SetTextAlign(GUI_TA_HCENTER);
    GUI_DispStringAt("GAUSS PDF ", 132, 5);
    GUI_DispStringAt("mu =0.0", 132, 20);

    const float mu = 0.0;
    const float sigma = 1.0;

   const int screen_width = 200;//264
   const int screen_height = 150;//176

   const int graph_width = 140;
   const int graph_height = 120;

   const int x_offset = 55;
   const int y_offset = 40;
    
    GUI_SetPenSize(3);
    GUI_DrawLine(x_offset, y_offset + graph_height, x_offset + graph_width, y_offset + graph_height);  // x-
    GUI_DrawLine(x_offset + graph_width / 2, y_offset, x_offset + graph_width / 2, y_offset + graph_height); // y-

    GUI_SetPenSize(1);
 

    
    const float x_start = -3.0f;
    const float x_end = 3.0f;
    const float x_step = 0.1f;
      
    GUI_SetFont(GUI_FONT_13_1);
    GUI_SetColor(GUI_BLACK);
    int x_neg_sigma = x_offset + (int)((-1.0f - x_start) / (x_end - x_start) * graph_width);
    GUI_DispStringAt("-s", x_neg_sigma - 8, y_offset + graph_height + 5);


   int x_zero = x_offset + (int)((0.0f - x_start) / (x_end - x_start) * graph_width);
   GUI_DispStringAt("0", x_zero - 3, y_offset + graph_height + 5);


   int x_pos_sigma = x_offset + (int)((1.0f - x_start) / (x_end - x_start) * graph_width);
   GUI_DispStringAt("+s", x_pos_sigma - 5, y_offset + graph_height + 5);
   int prev_px = -1, prev_py = -1;
   for (float x = x_start; x <= x_end; x += x_step)
{
    float y_max = normal_pdf(0.0f, mu, sigma);
    float y_scale = (float)graph_height / (y_max * 1.1f);
    float y = normal_pdf(x, mu, sigma);

    int px = x_offset + (int)((x - x_start) / (x_end - x_start) * graph_width);
    int py = y_offset + graph_height - (int)(y * y_scale);

    if (prev_px != -1 && prev_py != -1 &&
        px >= x_offset && px < (x_offset + graph_width) &&
        py >= y_offset && py < (y_offset + graph_height))
    {
         
        GUI_SetPenSize(2);              
        GUI_DrawLine(prev_px, prev_py, px, py);
    }

    prev_px = px;
    prev_py = py;
    

GUI_SetPenSize(2);  

      if (x >= -1.0f && x <= 1.0f)
{
    int thickness = 2;  

    for (int fill_y = py; fill_y < y_offset + graph_height; fill_y++)
    {
        if ((px + fill_y) % 4 == 0)
        {
            
            for (int dx = -thickness/2; dx <= thickness/2; dx++)
            {
                for (int dy = -thickness/2; dy <= thickness/2; dy++)
                {
                    GUI_DrawPixel(px + dx, fill_y + dy);
                }
            }
        }
    }
}



        }

    
    UpdateDisplay (CY_EINK_FULL_4STAGE, true);
}

void WaitforSwitchPressAndRelease (void)
{
    while (Status_SW2_Read() != 0);
    while (Status_SW2_Read() == 0);
}



int main(void)
{
    
    uint8 pageNumber = 0;
    
    __enable_irq(); 
    
    
    GUI_Init();

    
    Cy_EINK_Start(20);
    Cy_EINK_Power(1);
    Cy_EINK_ShowFrame(imageBufferCache, imageBufferCache, CY_EINK_FULL_4STAGE, true);



  
    ShowStartupScreen();
    

    WaitforSwitchPressAndRelease();
    
    for(;;)
    {
       (*demoPageArray[pageNumber])();
        
        WaitforSwitchPressAndRelease();
        pageNumber++;
        if (pageNumber>=NUMBER_OF_DEMO_PAGES)pageNumber=0;
    }
    }
